SET UNIQUE_CHECKS=false;
SET FOREIGN_KEY_CHECKS=true;
SET SQL_MODE='ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION';


DROP SCHEMA IF EXISTS Zinchenko;


CREATE SCHEMA IF NOT EXISTS Zinchenko DEFAULT CHARACTER SET utf8MB4;
USE Zinchenko;


CREATE TABLE IF NOT EXISTS Filials(
    idFilial INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fName VARCHAR(40) NOT NULL COMMENT 'Название',
    fDate DATE NOT NULL COMMENT 'Дата открытия',
    fChief VARCHAR(60) NOT NULL COMMENT 'Директор',
    fPhoneNum VARCHAR(11) NOT NULL COMMENT 'Номер телефона'
)  ENGINE=INNODB;
CREATE INDEX id_fDate ON Filials(fDate) using btree;


CREATE TABLE IF NOT EXISTS Customers(
    idCustomer INT NOT NULL AUTO_INCREMENT,
    FIO VARCHAR(60) NOT NULL COMMENT 'Фамилия имя отчество',
    UNIQUE INDEX UniqueidCustomer (idCustomer)
)  ENGINE=INNODB;


CREATE TABLE IF NOT EXISTS Cars (
    idCar INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
    fkFilial INT,
    fkCustomer INT,
    cBrand VARCHAR(15) NOT NULL COMMENT 'Марка',
    cModel VARCHAR(15) NOT NULL COMMENT 'Модель',
    cPhoto LONGBLOB COMMENT 'Фото',
    cCost INT NOT NULL COMMENT 'Стоимость',
    FOREIGN KEY (fkFilial) REFERENCES Filials (idFilial) 
		ON DELETE CASCADE 
        ON UPDATE CASCADE,
    FOREIGN KEY (fkCustomer) REFERENCES Customers (idCustomer)
)  ENGINE=INNODB;


