CREATE VIEW ViewMainSub AS
SELECT  Filials.idFilial, Filials.fName, Filials.fPhoneNum, Cars.cBrand, Cars.cModel, Cars.cPhoto, Cars.cCost
from Filials join Cars on Cars.fkFilial = Filials.idFilial where (Cars.cCost > 1400000);


CREATE FUNCTION MinCost() RETURNS INT DETERMINISTIC
	RETURN (SELECT min(cCost) AS cCost FROM Cars);


CREATE PROCEDURE CallView()
	SELECT * From ViewMainSub;


DELIMITER $ 
CREATE TRIGGER TrigOnUpd BEFORE insert ON Cars
FOR EACH ROW
BEGIN
	DECLARE t INT DEFAULT 0;
	SELECT COUNT(*) INTO t FROM Customers WHERE NEW.fkCustomer = Customers.idCustomer;
	IF t = 0 THEN
		signal sqlstate 'ERROR' set message_text = 'Клиента с таким номером нет. Повторите ввод';
	END IF;
END$


CREATE TRIGGER TrigOnDel AFTER DELETE ON Customers FOR EACH ROW
BEGIN
	DELETE FROM Cars WHERE fkCustomer = old.idCustomer;
END$
DELIMITER ;


